# MCUs

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_440030001251313236343430-if00
restart_method: command

[mcu EBB36]
canbus_uuid: fca3a5bf95e0

[printer]
kinematics: corexy
max_velocity: 1200
max_accel: 30000
max_accel_to_decel: 30000
max_z_velocity: 15          #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 350
square_corner_velocity: 5

#####################################################################
#   X/Y Stepper Settings
#####################################################################

##  B Stepper - Left
##  Connected to MOTOR_1
##  Endstop connected to EBB36:
[stepper_x]
step_pin: PC13
dir_pin: !PC14
enable_pin: !PE6
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200  #set to 400 for 0.9 degree stepper
position_min: 0
position_endstop: 355
position_max: 355
#endstop_pin: PF0
homing_positive_dir: true
homing_speed: 150 #Max 100
homing_retract_dist: 0

[tmc5160 stepper_x]
cs_pin: PG14
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: False
run_current: 2.80
sense_resistor: 0.075
stealthchop_threshold: 0
driver_TBL: 0
driver_TOFF: 3
driver_TPFD: 0
driver_HEND: 7
driver_HSTRT: 7


##  A Stepper - Right
##  Connected to MOTOR_1
##  Endstop connected to DIAG_1
[stepper_y]
step_pin: PE4
dir_pin: !PE5
enable_pin: !PE3
microsteps: 16
rotation_distance: 40
full_steps_per_rotation: 200  #set to 400 for 0.9 degree stepper
position_min: 0
position_endstop: 359
position_max: 359
#endstop_pin: PF2
homing_speed: 150  #Max 100
homing_retract_dist: 0
homing_positive_dir: true

[tmc5160 stepper_y]
cs_pin: PG13
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: False
run_current: 2.80
sense_resistor: 0.075
stealthchop_threshold: 0
driver_TBL: 0
driver_TOFF: 3
driver_TPFD: 0
driver_HEND: 7
driver_HSTRT: 7

#####################################################################
#   Z Stepper Settings
#####################################################################

## Z0 Stepper - Front Left
##  Connected to MOTOR_2
[stepper_z]
step_pin: PE1
dir_pin: !PE0
enable_pin: !PE2
microsteps: 16
endstop_pin: probe:z_virtual_endstop # use beacon as virtual endstop
homing_retract_dist: 0 # beacon needs this to be set to 0
rotation_distance: 40
gear_ratio: 80:16
position_min: -10
position_max: 310

[tmc5160 stepper_z]
cs_pin: PG12
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: True
run_current: 0.80
sense_resistor: 0.075
stealthchop_threshold: 0

##  Z1 Stepper - Rear Left
##  Connected to MOTOR_3
[stepper_z1]
step_pin: PB8
dir_pin: PB9
enable_pin: !PB7
microsteps: 16
rotation_distance: 40
gear_ratio: 80:16

[tmc5160 stepper_z1]
cs_pin: PG11
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: True
run_current: 0.80
sense_resistor: 0.075
stealthchop_threshold: 0

##  Z2 Stepper - Rear Right
##  Connected to MOTOR_4
[stepper_z2]
step_pin: PB5
dir_pin: !PB4
enable_pin: !PB6
microsteps: 16
rotation_distance: 40
gear_ratio: 80:16

[tmc5160 stepper_z2]
cs_pin: PG10
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: True
run_current: 0.80
sense_resistor: 0.075
stealthchop_threshold: 0

##  Z3 Stepper - Front Right
##  Connected to MOTOR_5
[stepper_z3]
step_pin: PG15
dir_pin: PB3
enable_pin: !PD5
microsteps: 16
rotation_distance: 40
gear_ratio: 80:16

[tmc5160 stepper_z3]
cs_pin: PG9
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: True
run_current: 0.80
sense_resistor: 0.075
stealthchop_threshold: 0


#####################################################################
#   Extruder
#####################################################################

##  Connected to MOTOR_6
##  Heater - HE0
##  Thermistor - T0
[extruder]
step_pin: EBB36:MOT_STEP
dir_pin: EBB36:MOT_DIR
enable_pin: !EBB36:MOT_EN
heater_pin: EBB36:HE0
rotation_distance: 47.088       #LDO Galileo 2
gear_ratio: 9:1                 #LDO Galileo 2
#rotation_distance: 22.6789511  #Bondtech 5mm Drive Gears
#gear_ratio: 50:8               #BMG Gear Ratio - CW2
microsteps: 16                  #Default 32
full_steps_per_rotation: 200    #200 for 1.8 degree, 400 for 0.9 degree
nozzle_diameter: 0.8
filament_diameter: 1.75
instantaneous_corner_velocity: 1.5
max_extrude_cross_section: 5
#sensor_type: ATC Semitec 104NT-4-R025H42G # For Revo Voron
#sensor_pin: EBB36:TH0                     #
sensor_type: MAX31865
sensor_pin: EBB36:PA4
spi_bus: spi1
rtd_nominal_r: 1000
rtd_reference_r: 4300
rtd_num_of_wires: 2
min_temp: 0
max_temp: 350
pwm_cycle_time: 0.02
smooth_time: 0.5
min_extrude_temp: 170
pressure_advance: 0.013
pressure_advance_smooth_time: 0.015
max_extrude_only_distance: 100
control = pid
pid_kp = 20.873
pid_ki = 1.016
pid_kd = 107.244

[tmc2209 extruder]
uart_pin: EBB36:MOT_UART
run_current: 0.6
stealthchop_threshold: 999999
interpolate: True

#####################################################################
#   Bed Heater
#####################################################################

[heater_bed]
##  SSR Pin - HE0
##  Thermistor - TB
heater_pin: PF6
sensor_type: Generic 3950
sensor_pin: PB1
pwm_cycle_time: 0.0166
max_power: 1.0
min_temp: 0
max_temp: 120
#control: pid
#pid_kp: 58.437
#pid_ki: 2.347
#pid_kd: 363.769

#####################################################################
#   Beacon Eddy Current Surface Scanner
#####################################################################

[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevD_E2FA1C55515137474C202020FF0C2E23-if00
x_offset: 0 # update with offset from nozzle on your machine
y_offset: 26.5 # update with offset from nozzle on your machine
mesh_main_direction: x
mesh_runs: 2

[safe_z_home]
home_xy_position: 175, 175 # update for your machine
z_hop: 3

#####################################################################
#   Fan Control
#####################################################################

[fan]
#  Print Cooling Fan - FAN1
pin: EBB36:FAN1      # FAN1 on EBB36
kick_start_time: 0.5
#  Depending on your fan, you may need to increase this value
#  if your fan will not start. Can change cycle_time (increase)
#  if your fan is not able to slow down effectively
off_below: 0.10

[heater_fan hotend_fan]
#  Hotend Fan - FAN2
pin: EBB36:FAN2     # FAN2 on EBB36
max_power: 1.0
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0
#  If you are experiencing back flow, you can reduce fan_speed
fan_speed: 1.0

[controller_fan controller_right]
pin: PA2
kick_start_time: 0.5
fan_speed: 0.4
shutdown_speed: 1.0 # Blast the fan if an error is triggered
heater: heater_bed
hardware_pwm: True
cycle_time: 0.00004 # 25 kHz
# RPM monitoring:
tachometer_pin: PC2
tachometer_ppr: 2

[controller_fan controller_left]
pin: PF8
kick_start_time: 0.5
fan_speed: 0.4
shutdown_speed: 1.0 # Blast the fan if an error is triggered
heater: heater_bed
hardware_pwm: True
cycle_time: 0.00004 # 25 kHz
# RPM monitoring:
tachometer_pin: PC1
tachometer_ppr: 2

[temperature_fan HostAndMCU]
pin: PA1
#max_power:
shutdown_speed: 1.0
cycle_time: 0.00004 # 25 kHz
hardware_pwm: True
kick_start_time: 0.5
#off_below:
tachometer_pin: PC3
tachometer_ppr: 2
#tachometer_poll_interval:
#enable_pin:
#   See the "fan" section for a description of the above parameters.
sensor_type: temperature_host
#sensor_pin:
control: pid
#max_delta:
min_temp: 10
max_temp: 100
#   See the "extruder" section for a description of the above parameters.
pid_Kp: 1.0
pid_Ki: 0.5
pid_Kd: 2.0
#   The proportional (pid_Kp), integral (pid_Ki), and derivative
#   (pid_Kd) settings for the PID feedback control system. Klipper
#   evaluates the PID settings with the following general formula:
#     fan_pwm = max_power - (Kp*e + Ki*integral(e) - Kd*derivative(e)) / 255
#   Where "e" is "target_temperature - measured_temperature" and
#   "fan_pwm" is the requested fan rate with 0.0 being full off and
#   1.0 being full on. The pid_Kp, pid_Ki, and pid_Kd parameters must
#   be provided when the PID control algorithm is enabled.
#pid_deriv_time: 2.0
#   A time value (in seconds) over which temperature measurements will
#   be smoothed when using the PID control algorithm. This may reduce
#   the impact of measurement noise. The default is 2 seconds.
target_temp: 40.0
#   A temperature (in Celsius) that will be the target temperature.
#   The default is 40 degrees.
max_speed: 1.0
#   The fan speed (expressed as a value from 0.0 to 1.0) that the fan
#   will be set to when the sensor temperature exceeds the set value.
#   The default is 1.0.
min_speed: 0.3
#   The minimum fan speed (expressed as a value from 0.0 to 1.0) that
#   the fan will be set to for PID temperature fans.
#   The default is 0.3.
gcode_id: electronics_intake
#   If set, the temperature will be reported in M105 queries using the
#   given id. The default is to not report the temperature via M105.

#####################################################################
#   Temperature Sensors
#####################################################################

[temperature_sensor OctopusMaxEZ]
sensor_type: temperature_mcu

